View the Video Description for this product! (Please note that the color shown in the video may no longer be available.)<br>・Following up on the success of the Rob Machado Experience  Dragon(TM) took a mellow step down and created the Experience 2. With the same vibe and style as its bigger  in-your-face predecessor  the Experience 2 comes in a scaled-down look that compromises on size  not on flavor.<br>・Signature Rob Machado style.<br>・Grilamid frames are durable and offer up a unique handmade look.<br>・Dragon logo details on side temples.<br>・Five-barrel hinges.<br>・Offers 100% UV protection.<br>・Six-base polycarbonate lenses.<br>・Made in Italy.<br>Measurements ・Temple Length  127 mm<br>・Frame Width  141 mm<br>・Weight  1 oz<br>・Lens Height  48 mm<br>・Lens Width  60 mm<br>・Bridge  17 mm<br><br>この製品のためのビデオ記述を見てください!(ビデオの中で示される色がもはや利用可能ではないかもしれないことに注意してください。)ロブ・マシャド経験の成功上で対応して、ドラゴンは芳醇に下へ一歩進み、経験2を生み出しました。同じ感じおよびスタイルで、そのより大きく、押しの強い前任者として、経験2は、ロブ・マシャドstyle.Grilamidフレームがそうであるflavor.Signatureに、サイズについて妥協するスケールダウンした外観に来ません、永続性、そして、提示する、を上へ、1つの、側面のtemples.Fiveな樽hinges.Offersについてのユニークな手製のlook.Dragonロゴ詳細、Italy.Measurementsの中の100%のUV protection.Six-基礎ポリカーボネートlenses.Made 寺院長さ 127のmmFrame幅 141 mmWeight 1つのozLens高さ 48のmmLens幅 60 mmBridge 17mm<br><br>※商品説明及びスペック等の日本語文は、自動翻訳されており理解しづらいところも多々見受けられると思いますが何卒ご了承下さい。また、ご不明な点等がございましたら、お気軽にお問い合わせ下さいませ。<br><br></DIV>
