View the Video Description for this product! (Please note that the color shown in the video may no longer be available.)<br>・Day in and day out  you'll be stuntin' these bold Neff(R) sunglasses.<br>・Tough and durable polycarbonate lenses.<br>・Plastic frames shaped in a classic retro shape.<br>・Neff wordmarking on side temples.<br>・Neff logo detail on inside temple tips.<br>・Stainless steel hinges.<br>・Neff cloth bag included.<br>Measurements ・Temple Length  142 mm<br>・Frame Width  146 mm<br>・Weight  1.1 oz<br>・Lens Height  45 mm<br>・Lens Width  54 mm<br>・Bridge  15 mm<br><br>この製品のためのビデオ記述を見てください!(ビデオの中で示される色がもはや利用可能ではないかもしれないことに注意してください。)明けても暮れても、これらの大胆なネフsunglasses.Toughおよび永続性のポリカーボネートの成長を妨げるでしょう、寺院tips.Stainless鋼hinges.Neff布袋included.Measurementsの内部で側面のtemples.Neffロゴ詳細上でwordmarkingし続ける古典的なリバイバルのshape.Neffの中で形作られたlenses.Plasticな構造 寺院長さ 142のmmFrame幅 146 mmWeight 1.1のozLens高さ 45のmmLens幅 54 mmBridge 15mm<br><br>※商品説明及びスペック等の日本語文は、自動翻訳されており理解しづらいところも多々見受けられると思いますが何卒ご了承下さい。また、ご不明な点等がございましたら、お気軽にお問い合わせ下さいませ。<br><br></DIV>
